        allCardsHistory.push(cardname);

        const prev_running_count = running_count;

        if(cardname.includes('2') || cardname.includes('3') || cardname.includes('7')){
            running_count++;
        } else if(cardname.includes('4') || cardname.includes('5') || cardname.includes('6')){
            running_count += 2;
        } else if(cardname.includes('J') || cardname.includes('Q') || cardname.includes('K') || cardname.includes('T')){
            running_count -= 2;
        } else if(cardname.includes('9')){
            running_count--;
        } else if (cardname.includes('A') || cardname.includes('8')){
            // do nothing
        } else {
            bjlog('unknown card: ' + cardname, 1);
        }

        thisRoundCards.push(cardname);

        bjlog('new card: ' + cardname + "("+(running_count - prev_running_count)+")");

        bjpokerfindCardsArea().innerHTML = "<p>this round cards: " + thisRoundCards.toString() + "</p>";
        bjpokerfindCardsArea().innerHTML += "<p>all cards: " + allCardsHistory.toString() + "</p>";
