    function bjdecideCall() {
        // Calculate the total of the player's hand
        let playerHand = bjgetMyHand();
        let playerTotal = calculateHandTotal(playerHand);
        let trueCount = running_count / number_of_decks;
        let dealerUpCard = bjgetDealerUpCard();

        bjlog('player total: ' + playerTotal);

        // Calculate total hand value (both hard and soft totals)
        function calculateHandTotal(hand) {
            let total = 0;
            let aceCount = 0;

            for (let card of hand) {
                if (['K', 'Q', 'J', 'T'].includes(card)) {
                    total += 10;
                } else if ('A'.includes(card)) {
                    aceCount++;
                    total += 11;  // Initially, treat Ace as 11
                } else {
                    total += parseInt(card[0]);
                }
            }

            // Adjust for Aces if total exceeds 21
            while (total > 21 && aceCount > 0) {
                total -= 10;
                aceCount--;
            }

            return total;
        }

        // Basic strategy:

        var stand_at = 17;

        // if dealar up card < 10, stand at 14
        //if(!['K', 'Q', 'J', 'T', 'A'].includes(dealerUpCard)) stand_at = 14;

        return playerTotal >= stand_at ? 'stand' : 'hit';






        // if card counting is used:


        // Helper functions to determine if the hand is soft
        function isSoftHand(hand) {
            return hand.includes('A') && calculateHandTotal(hand) <= 21 && calculateHandTotal(hand) != calculateHardTotal(hand);
        }
        function calculateHardTotal(hand) {
            let total = 0;

            for (let card of hand) {
                if (['K', 'Q', 'J', 'T'].includes(card)) {
                    total += 10;
                } else if ('A'.includes(card)) {
                    total += 11;
                } else {
                    total += parseInt(card[0]);
                }
            }

            return total;
        }


        // Soft hands
        if (isSoftHand(playerHand)) {
            if (playerTotal === 18) {
                if (dealerUpCard === '2' || dealerUpCard === '7' || dealerUpCard === '8') {
                    return 'stand';
                } else {
                    return 'hit';
                }
            } else if (playerTotal >= 19) {
                return 'stand';
            } else {
                return 'hit';
            }
        }
        else {
            // Hard hands

            if (playerTotal >= 17) {
                return 'stand';  // Always stand on 17 or higher
            } else if (playerTotal <= 11) {
                return 'hit';  // Always hit on 11 or less
            } else if (playerTotal === 12) {
                if (['4', '5', '6'].includes(dealerUpCard)) {
                    return 'stand';
                } else {
                    return 'hit';
                }
            } else if (playerTotal >= 13 && playerTotal <= 16) {
                if (['2', '3', '4', '5', '6'].includes(dealerUpCard)) {
                    return 'stand';
                } else {
                    return 'hit';
                }
            }
        }

        // Adjust based on the running count (card counting)
        // Positive count -> stand more often, Negative count -> hit more often
        if (trueCount > 3) {
            // In very favorable conditions (high positive count), be more conservative and stand
            if (playerTotal >= 12 && playerTotal <= 16 && dealerUpCard >= '7') {
                return 'stand';  // In positive counts, stand even on weaker hands
            }
        } else if (trueCount < -1) {
            // In unfavorable conditions (low or negative count), hit more aggressively
            if (playerTotal >= 12 && playerTotal <= 16) {
                return 'hit';  // Hit more often if count is negative
            }
        }

        // Default to basic strategy if no specific adjustments apply
        return playerTotal >= 17 ? 'stand' : 'hit';
    }







