    // add feed area listener
    function addThorFeedAreaListener(){

        function findThorFeedArea(){
            return document.getElementsByClassName('totalWins')[0];
        }

        // add event listener to detect every time a card is played
        // wait until cards area exists, then add event listener
        let feedAreaInterval = setInterval(function(){
            if(findThorFeedArea()){
                thorlog('added feed area listener');
                findThorFeedArea().addEventListener("DOMNodeInserted", function(){
        
                    const text = findThorFeedArea().innerHTML;

                    thorlog("|-- text="+text+" -- last_v="+last_v+" --|");
    
                    if(text=="0") return;
                
                    if(text == "GOOD LUCK!" /*|| text=="0"*/){
                        // this means new spin has started
                        counter++;
                
                        // find out what previous spin was
                        if(last_v == "PRESS SPIN!") {
                            // we lost
                            thorgotSpinResult(0);
                        } else {
                            // we won
                            const last_v_no_dots = last_v.replace(/\./g, '');
                            const v = parseInt(last_v_no_dots);
                            thorgotSpinResult(v);
                        }
                
                    }else{
                        last_v = text;
                    }
                    
                });
                clearInterval(feedAreaInterval);
            }
        }, 1000);
    }
