    // when page loads check if wallpaper is set
    function checkWallpaper() {
        const base64 = localStorage.getItem('wallpaper');
        if (base64 && base64 !== "") {
            findEngineMain().style.cssText += base64ToCSS(base64);
        }else{
            const default_img = "";
            localStorage.setItem('wallpaper', default_img);
            findEngineMain().style.cssText += base64ToCSS(default_img);
        }
    }
